class PostfixEquation {
    constructor(infix) {
        this.infix = infix;
        this.priority0 = [
            '+', '-'
        ]
        this.priority1 = [
            '*', '/'
        ]
        this.priority2 = [
            '%'
        ]
        this.tempStack = [];
        this.output = [];
    }

    covertToEquation(){
        const variab = this.infix.map((individualElem) =>
        {
            console.log(individualElem);
            return 'hey'
        }

    );
    }
}

export default PostfixEquation;
